name: simple-aws
description: A simple calculation of Carbon and energy from an AWS RDS DB
tags:
aggregation:
  metrics:
    - "carbon"
    - "energy"
  type: "horizontal"
initialize:
  outputs:
    - yaml
  plugins:
    "teads-aws":
      method: TeadsAWS
      path: "@grnsft/if-unofficial-plugins"
      global-config:
        interpolation: linear
    sci-o:
      method: SciO
      path: "@grnsft/if-plugins"
    sum:
      method: Sum
      path: "@grnsft/if-plugins"
      global-config:
        input-parameters: ["carbon-operational", "carbon-embodied"]
        output-parameter: "carbon"
    divide:
      method: Divide
      path: "@grnsft/if-plugins"
      global-config:
        numerator: carbon
        denominator: readwrite
        output: sci (gCO2/readwrite)

tree:
  children:
    child:
      pipeline:
        - teads-aws
        - sci-o
        - sum
        - divide
      defaults:
        cloud/instance-type: m5.xlarge
        grid/carbon-intensity: 132
